export const NavbarCSS = {
  appbar: { backgroundColor: "#304FA1", px: "50px" },

  image: {
    flex: 1,
    display: "flex",
    alignItems: "center",
    height: "120px",
  },
  logoTitle: {
    color: "#fff",
    cursor: "pointer",
    "&:active": {
      backgroundColor: "#f00",
    },
  },
  link: {
    textDecoration: "none",
    color: "#fff",
  },
  listItem: {
    listStyle: "none",
    WebkitTransition: "all 0.5s",
    transition: "all 0.5s",
    transitionTimingFunction: "ease",
    marginLeft: "10px",
    marginRight: "10px",
  },
  listItemHover: {
    fontSize: "18",
    transitionTimingFunction: "ease",
  },
  borderDiv: {
    paddingTop: 1,
    paddingBottom: 1,
    backgroundColor: "#fff",
    position: "absolute",
    bottom: 0,
    width: "0%",
    WebkitTransition: "all 0.5s",
    transition: "all 0.5s",
    transitionTimingFunction: "ease",
  },
  borderDivHover: {
    width: "80%",
    transitionTimingFunction: "ease",
  },
};
